import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<App posts={posts} mainPhoto={mainPhoto} dialogs={dialogs} messages={messages}/>, document.getElementById('root'));

serviceWorker.unregister();
